import Button from "react-bootstrap/Button";
import Form from "react-bootstrap/Form";
import useFetch from "../../hooks/useFetch.js";
import "../Tela.css"
const url = "http://localhost/quests/temas";

const Form2 = () => {   
 
    const { data: items , httpConfig, loading, error} = useFetch(url);

    //Envia dados

    return <>
                    <h2>Escolha seus interesses</h2>
                    <Form.Group className="mb-2">
                    <Form.Label htmlFor="genero">Quais s√£o os seus interesses?</Form.Label>
                    <div class="form-check">

                        {loading && <p>Carregando Dados...</p>}
                        {error &&<p>{error}</p>}
                        {!loading && <ul>
                        {items && items.map((tema) => (
                            <li key={tema.id_tema}>
                                <input class="form-check-input" type="checkbox" value="" id="flexCheckDefault"/>
                                <label class="form-check-label" for="flexCheckDefault">
                                    {tema.tema}
                                </label>
                            </li>
                        ))}
                        </ul>}
                    
                    </div>
                    </Form.Group>

                    <br/>
                    <Button variant="primary" type="submit" className="px-5 mb-3 mt-3">
                    Enviar
                    </Button>   
    </>
}

export default Form2;
